import React from 'react';

import Day from './Day';

const days = (props) => props.days.map( ( day, index ) => {
        console.log(day);
        return <Day key={index}
            dt={day.dt_txt}
            icon={"http://openweathermap.org/img/w/" + day.weather[0].icon + ".png"}
            weather={day.weather[0].main}
            temp={day.main.temp} />
      } );

export default days;
